import { Button, Image, Text, VStack } from '@chakra-ui/react'
import React from 'react'

const card = ([amount, img, checkoutHandler]) => {
  return (
    <VStack>
        <Image src={img} />
        <Text>{amount}</Text>
        <Button onClick={checkoutHandler}>Buy Now</Button>
    </VStack>
  )
}

export default Card
